/**
 * SharedStorage used to sync data between workers
 */
class SharedStorage extends BaseStorage {
    /**
     * @param {BaseStorage} storage
     */
    constructor(storage) {
        super()

        this._storage = storage
        this._callbacks = {}
    }

    /**
     * @param {object} msg
     * @param {Worker} worker
     */
    handleMessageFromWorkers(msg, worker) {
        msg = Message.deserialize(msg)

        if (msg instanceof GetMessage) {
            this._storage.get(msg.storage, msg.key)
                .then(data => {
                    worker.send(Message.response(data, msg.id).serialize())
                })
        }

        if (msg instanceof SetMessage) {
            this._storage.set(msg.storage, msg.key, msg.value)
                .then(() => {
                    worker.send(Message.response(null, msg.id).serialize())
                })
        }

        if (msg instanceof RemoveMessage) {
            this._storage.remove(msg.storage, msg.key)
                .then(() => {
                    worker.send(Message.response(null, msg.id).serialize())
                })
        }
    }

    /**
     * @param {object} msg
     */
    handleMessageFromMaster(msg) {
        msg = Message.deserialize(msg)

        if (msg instanceof ResponseMessage) {
            this._callbacks[msg.id](msg.data)
        }
    }

    /**
     *
     * @param {string} storage
     * @param {string} key
     * @returns {Promise<Object>}
     */
    get(storage, key) {
        return new Promise(resolve => {
            let id = this._genId()

            this._callbacks[id] = resolve

            process.send(Message.get(storage, key, id).serialize())
        })
    }

    /**
     *
     * @param {string} storage
     * @param {key} key
     * @param {Object} data
     * @returns {Promise<>}
     */
    set(storage, key, data) {
        return new Promise(resolve => {
            let id = this._genId()

            this._callbacks[id] = resolve

            process.send(Message.set(storage, key, data, id).serialize())
        })
    }

    /**
     *
     * @param {string} storage
     * @param {string} key
     */
    remove(storage, key) {
        return new Promise(resolve => {
            let id = this._genId()

            this._callbacks[id] = resolve

            process.send(Message.remove(storage, key, id).serialize())
        })
    }

    /**
     * @returns {string}
     * @private
     */
    _genId() {
        return Math.random().toString(36).substring(7)
    }
}

module.exports = SharedStorage

'use strict'

const GetMessage = require('./GetMessage')
const SetMessage = require('./SetMessage')
const RemoveMessage = require('./RemoveMessage')
const ResponseMessage = require('./ResponseMessage')

class Message {
    constructor(type, payload) {
        this._type = type
        this._payload = payload
    }

    /**
     * @param {string} storage
     * @param {string} key
     * @param {string} id
     */
    static get(storage, key, id) {
        return new Message('get', new GetMessage(storage, key, id))
    }

    /**
     * @param {string} storage
     * @param {string} key
     * @param {object} value
     * @param {string} id
     */
    static set(storage, key, value, id) {
        return new Message('set', new SetMessage(storage, key, value, id))
    }

    /**
     * @param {string} storage
     * @param {string} key
     * @param {string} id
     */
    static remove(storage, key, id) {
        return new Message('remove', new RemoveMessage(storage, key, id))
    }

    /**
     * @param {object} data
     * @param {string} id
     * @returns {Message}
     */
    static response(data, id) {
        return new Message('response', new ResponseMessage(data, id))
    }

    /**
     * @returns {object}
     */
    serialize() {
        return {
            type: this._type,
            payload: this._payload.serialize()
        }
    }

    static deserialize(raw) {
        switch (raw.type) {
            case 'get':
                return GetMessage.deserialize(raw.payload)
                break

            case 'set':
                return SetMessage.deserialize(raw.payload)
                break

            case 'remove':
                return RemoveMessage.deserialize(raw.payload)
                break

            case 'response':
                return ResponseMessage.deserialize(raw.payload)
                break

            default:
                return null
                break
        }
    }
}

module.exports = Message

