const http = require('http')
const path = require('path')
const fs = require('fs')

class WebAdmin {
    /**
     * @param {string} host
     * @param {number} port
     * @param {string} path
     * @param {WebAdminLogger} logger
     * @param {Telegram} telegram
     */
    constructor(host, port, path, logger, telegram) {
        this._host = host
        this._port = port
        this._path = path
        this._logger = logger
        this._telegram = telegram

        this._server = http.createServer((request, response) => {
            this._handleRequest(request, response)
        }).listen(this._port, this._host)

        this._logger.log({ 'WebAdmin ': `started at ${host}:${port}`})
    }

    /**
     * @param request
     * @param response
     * @private
     */
    _handleRequest(request, response) {
        let reqPath =  path.join(this._path, request.url == '/' ? '/index.html' : request.url)

        switch (request.url) {
            case '/logs':
                response.end(this._logger.getAllLogs())
                break
            case '/restartWorkers':
                this._telegram.restartWorkers()
                response.end('ok')
                break
            case '/downloadLogs':
                response.writeHead(200, {
                    'Content-Type': 'text/plain',
                    'Content-Disposition': 'attachment; filename=logs.txt'
                })
                response.end(this._logger.getAllLogs())
                break
            case '/statistics':
                response.end(JSON.stringify({
                    totalRequests: this._telegram.statistics.getTotalRequestsCount(),
                    requestsForWorkers: this._telegram.statistics.getWorkersRequests(),
                    uptime: this._telegram.statistics.getUptime(),
                    workersStatus: this._telegram.statistics.getWorkersStatus()
                }))

        }

        fs.lstat(reqPath, (err, stats) => {
            if (stats && stats.isFile()) {
                this._sendFile(response, reqPath, stats.size)
            }
            else {
                this._sendNotFound(response)
            }
        })
    }

    /**
     * @param response
     * @param {string} filePath
     * @param {number} size
     * @private
     */
    _sendFile(response, filePath, size) {
        const fileStream = fs.createReadStream(filePath)
        const ext = path.parse(filePath).ext

        response.writeHead(200, {
            'Content-Type': this._getMimeType(ext),
            'Content-Length': size
        })

        fileStream.pipe(response)
    }

    /**
     * @param extension
     * @returns {*}
     * @private
     */
    _getMimeType(extension) {
        switch (extension) {
            case '.html':
                return 'text/html'
            case '.js':
                return 'application/javascript'
            case '.css':
                return 'text/css'
            case '.svg':
                return 'image/svg+xml'
            default:
                return 'text/plain'
        }
    }

    /**
     * @param response
     * @private
     */
    _sendNotFound(response) {
        response.writeHead(404)
        response.end('404 Not found')
    }
}

module.exports = WebAdmin

'use strict'

const BaseUpdateFetcher = require('./BaseUpdateFetcher')
const http = require('http')
const Update = require('../models/Update')

class WebhookUpdateFetcher extends BaseUpdateFetcher {
    /**
     * @param {TelegramApi} api
     * @param {BaseLogger} logger
     * @param {string} url
     * @param {string} host
     * @param {number} port
     * @param {string} apiToken
     */
    constructor(api, logger, url, host, port, apiToken) {
        super(api, logger)

        this._url = url
        this._host = host
        this._port = port
        this._apiToken = apiToken

        this._server = http.createServer((req, res) => this._handleRequest(req, res))
    }

    /**
     * @param {fetchUpdatesCallback} callback
     */
    fetch(callback) {
        this._callback = callback
        this._getUpdates()
    }

    /**
     * @private
     */
    _getUpdates() {
        this._api.setWebhook({ url: this._url })
            .then(() => {
                this._server.listen(this._port, this._host, () => {
                    this._logger.log({ WebhookUpdateFetcher: `Server started at ${this._host}:${this._port}` })
                })
            })
    }

    /**
     * @param req
     * @param res
     * @private
     */
    _handleRequest(req, res) {
        const validateRegExp = new RegExp(this._apiToken)

        if (!validateRegExp.test(req.url)) {
            this._logger.error({ webhook: 'Not authorized request from Telegram' })
            res.statusCode = 401
            res.end()
        } else if (req.method === 'POST') {
            let chunks = []

            req.on('data', chunk => {
                chunks.push(chunk)
            })

            req.on('end', () => {
                res.end('OK')

                const data = Buffer.concat(chunks).toString('utf-8')
                let parsedUpdate

                try {
                    parsedUpdate = JSON.parse(data)
                }
                catch (e) {
                    this._logger.error({ 'Error parsing webhook update from json': e })
                }

                if(!parsedUpdate)
                    return

                this._logger.log({ webhook: 'Got ', update: parsedUpdate })

                const update = Update.deserialize(parsedUpdate)

                this._callback([update])
            })
        } else {
            this._logger.error({ webhook: 'Authorized request from Telegram but not a POST' })

            res.statusCode = 400
            res.end()
        }
    }
}

module.exports = WebhookUpdateFetcher

